import React from 'react'

function NameList1() {

    const names = ['Ratnesh1', 'Rajiv1', 'Navin1']

    return (

        <div>
            <h2>{names[0]}</h2>
            <h2>{names[1]}</h2>
            <h2>{names[2]}</h2>
        </div>
    )
}

export default NameList1
